import { Component, Inject ,OnInit } from '@angular/core';
import { MAT_DIALOG_DATA, MatDialogRef } from '@angular/material/dialog';
import { MatSnackBar } from '@angular/material/snack-bar';
import { ApiService } from '@services/api.service';
import { LogService } from '@services/log-service.service';
import { ToastrService } from 'ngx-toastr';

@Component({
  selector: 'app-validar-permiso-item',
  templateUrl: './validar-permiso-item.component.html',
  styleUrls: ['./validar-permiso-item.component.scss']
})

export class ValidarPermisoItemComponent implements OnInit {

  get_item: any = [];

  constructor(public log_module:LogService, public dialogRef: MatDialogRef<ValidarPermisoItemComponent>, 
    private api: ApiService, public _snackBar: MatSnackBar, @Inject(MAT_DIALOG_DATA) public dataItem: any){

  }

  ngOnInit(){
    this.get_item = this.dataItem.dataItem;

    console.log(this.get_item);
  }

  onNoClick(): void {
    this.dialogRef.close(false);
  } 

  confirmado(): void {
    this.dialogRef.close(true);
  }

}
<h1 mat-dialog-title>Validar</h1>
<div mat-dialog-content style="text-align: center;">
  Para actualizar el precio de cualquier item necesita un permiso especial.
</div>

<div mat-dialog-actions style="justify-content: center !important;">

  <button mat-button mat-dialog-close cdkFocusInitial color="primary" (click)="confirmado()"><i
      class="fa fa-check"></i>&nbsp; Aceptar</button>

  <button mat-button mat-dialog-close color="warn" class="example-label" (click)="onNoClick()"><i
      class="fa fa-close"></i>&nbsp;
    Cancelar</button>
</div>
